import { HeaderImage, StyledNavbar, StyledContainer ,RightContainer} from "./styles";
import logo from "./image1.svg";
import { FaSearch } from "react-icons/fa";

export const Navbar = (probs) => {
  return (
    <StyledNavbar>
      <StyledContainer>
        <HeaderImage image={logo}>   
            <img src={logo} alt="image" />
               </HeaderImage>
               <ul>
                 <li>Movies</li>
                 <li>About</li>
                 <li>Offers</li>
                 <li>Offers</li>
               </ul>
      </StyledContainer>
      <RightContainer>
      <ul>
                 <li><a>+</a></li>
                 <li><div>EN</div></li>
                 <li>Login</li>
                 <li>Join TMDB</li>
                 <li><FaSearch size={20} color={'#0291BC'}></FaSearch></li> 
               </ul>

         </RightContainer>
    </StyledNavbar>
  );
};
